import {Fragment} from "react";

function Temp() {
    const text = 'hello';

    const myStyleForText = {
        color : 'red',
        margin : '0 auto',
        textAlign : 'center'
    };

    return (
        <Fragment>
            <h1
            style={myStyleForText}>
                {text}
            </h1>
        </Fragment>
    )
}

export default Temp;
